import { BrowserRouter, Route, Routes, Link } from "react-router-dom";
import { Header } from "./components/Header";
import Main from "./components/main";
import { Existing } from "./pages/Extisting";

function App() {
  return (
    <div className="app">
      <Login />
    </div>
  );
}
function Login() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/pages/Exisitng" element={<Existing />} />
        </Routes>
      </BrowserRouter>
      <div>
        <Header />
        <div className="logincon">
          <h2>Login</h2>
          <Link>
            <button>Existing Trip</button>
          </Link>
          <button>Create Trip</button>
        </div>
      </div>
    </div>
  );
}

export default App;
